// src/pages/Contact.js

import React from 'react';

function Contact() {
  return (
    <div className="contact-page">
      <h1>Contact Me</h1>
      <p>
        Email me at: <a href="mailto:your_email@example.com">your_email@example.com</a>
      </p>
      {/* Optionally add a contact form or social media links */}
    </div>
  );
}

export default Contact;
